import { Box, Flex, Heading, Image } from "@chakra-ui/react";
import React from "react";


const Home = () => {
  return <Box id="home" >
     <Flex p={10} >
      <Box>
    <Heading>Hey ! I'm Shivam</Heading>
      </Box>
      <Box>
      <Image
  borderRadius='full'
  boxSize='150px'
  src='https://bit.ly/dan-abramov'
  alt='Dan Abramov'
/>
      </Box>
     </Flex>
  </Box>
};

export default Home;
